import React, { Component } from "react";
import Signin from "./components/signin"

class Sign extends Component {
  constructor() {
    super();
    this.state = { isRegister: false };
  }
  toggleRegister = (state) => () => this.setState({ isRegister: state });
  render() {
    return (
      <Signin />
    );
  }
}

export default Sign;
